// src/App.jsx
import React, { useState, useEffect } from 'react';
import Header from './components/Header';
import TransactionTable from './components/TransactionTable';

function App() {
  const [transactions, setTransactions] = useState([]);

  useEffect(() => {
    // Datos de ejemplo (reemplaza con tu llamada a la API)
    const initialTransactions = [
      { "id": 7066, "customername": "SparrowDash", "customerid": 2, "revenuesourcename": "NebulaVibes", "revenuesourceid": 12, "currencycode": "EUR", "transactiondate": "2023-12-26" },
      { "id": 18714, "customername": "SparrowDash", "customerid": 2, "revenuesourcename": "RocketRoo", "revenuesourceid": 13, "currencycode": "EUR", "transactiondate": "2024-03-14" },
      // ... más datos de ejemplo
    ];
    setTransactions(initialTransactions);
  }, []);

  return (
    <div className="App">
      <Header />
      <h1>Transaction Data</h1>
      <TransactionTable transactions={transactions} />
    </div>
  );
}

export default App;
